    {
        /* for ~unique_ptr */
    }

    PointGFp Blinded_Point_Multiply::blinded_multiply(const BigInt& scalar,
                                                      RandomNumberGenerator& rng)
    {
        return m_point_mul->mul(scalar, rng, m_order, m_ws);
    }

